webpackJsonp([73467886779571],{6944:function(o,t){o.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/08/crh_concorde.jpg" alt="Christopher and his Concorde" /></p>\n<p>Christopher\'s favorite website is the <a href="http://www.airbus.com/media/video_clips.asp">video page at Airbus</a>, especially the <a href="http://www.airbus.com/video/media/mpegs/concorde_l.mpg">Concorde\'s final landing</a>. So it was only natural that he wanted a toy Concorde of his very own. </p>\n<p>At German toy stores we could only find tiny models for collectors for 20, but on eBay we found a <a href="http://www.givesomecharacter.com/phdi/p1.nsf/supppages/givesome?OpenDocument&part=14">shop</a> in Great Britain that  sold a <a href="http://www.corgi.co.uk/CorgiSite/pages/product/product.asp?ctlg=Corgi&ctgry=Toys&prod=59902">model by Corgi</a> for around 12 (incl. postage). It arrived today.</p>',fields:{title:"Concorde",date:"03 Aug 2004",url:"https://papascott.de/2004-08-03-concorde/"}}},pathContext:{slug:"/2004-08-03-concorde/",prev:{fields:{title:"Blogg Topping",date:"03 Aug 2004",slug:"/2004-08-03-blogg-topping/"}},next:{fields:{title:"Radicati Group",date:"03 Aug 2004",slug:"/2004-08-03-radicati-group/"}}}}}});
